import React from "react";
import HyperCard from "./HyperCard";
// import { Card } from "semantic-ui-react";

function HyperCarCollection ( {hyperCar} ) {

const displayHyperCar = hyperCar.map((hyper) => {

     return (
        < HyperCard 
        hyper= {hyper}
        key= {hyper.id}
      />

     )
})

    return (
        <div> 
          {displayHyperCar}
        </div>
      );
}

export default HyperCarCollection;
